    HymnsContent(id: 1992, position: 5, content: "Li tuisile vowelema \nOcinyei cesunga lialio, \nLi sandeke eyovo liove, \nOco tu lombela.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_93, typeStanza: HymnsContentCode.VERSE),
