    HymnsContent(id: 1994, position: 1, content: "Usoma wa Suku \nNdu sole, lonjo ya’e, \nLekongelo lia yowiwa\nLosonde yomola’e.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_94, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1995, position: 2, content: "Ndu talela ohali, \nHawo ndu lombela, \nKokuawo nalavaya ño-o, \nTe upange u pua.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_94, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1996, position: 3, content: "Wa piãla enene \nUwale wokilu. \nOvitua viawo njolela, \nViesunga lia Suku.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_94, typeStanza: HymnsContentCode.VERSE),
