    HymnsContent(id: 2002, position: 1, content: "Esĩla Lionembele \nKristu Upopeli; \nUnene Wa'e wa piala, \nNdaño ocisola ca’e. \nWa kale ale osimbu \nKuenda okala hũ \nWa pama, Okola, Onene, \nKa ka nyoleha mbu.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_96, typeStanza: HymnsContentCode.VERSE),
