    HymnsContent(id: 2016, position: 3, content: "Vokiya imuenyo vietu, \nEkolelo lepandi. \nKupange ku ka tave, \nNda umue otokoka. \nTu pamise a Ñala, \nTu yukise lutõi, \nLoku tu lekisavo \nOcisola cavo.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_99, typeStanza: HymnsContentCode.VERSE),

