    HymnsContent(id: 2018, position: 2, content: "Ava va nyelela voluali, \nValekisa onjila. \nLa vosi vana vasina, \nVa yevisa ondaka yove. \nAva va vela, \nNdo va popele a Ñala.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_100, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2019, position: 3, content: "Songuila ava va sumua lekavo, \nKo cunda cove a Ñala. \nAmabata otumãla tuosi, \nPonete yove, Ongombo. \nVatekola \nLocisola co kilu.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_100, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2020, position: 4, content: "A Yesu yeva elombelo, \nLiava va samba calua. \nNdo yukise ocunda cove, \nLolopandu viocili. \nTu sivaya \nOhenda ya piãla.", hymnsNumber: UmHymnsNumberSeeder.CHURCH_100, typeStanza: HymnsContentCode.VERSE),

