    HymnsContent(id: 2023, position: 3, content: "Vonjila ya yanja, \nYokufa luvali, \nSatana otu kavisa, \nOwusa uli pi?", hymnsNumber: UmHymnsNumberSeeder.CHURCH_101, typeStanza: HymnsContentCode.VERSE),
